import { styled } from "styled-components"

const StyledMain = styled.main`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: 50px;
  padding-bottom: 50px;
  min-height: 100vh;
`

export default function Main() {
  return StyledMain
}
